import React from 'react';
import createEngine, { 
    DefaultLinkModel, 
    DefaultNodeModel,
    DiagramModel 
} from '@projectstorm/react-diagrams';

import { CanvasWidget } from '@projectstorm/react-canvas-core';

function DataModelDiagram() {
    // Create an instance of the engine
    const engine = createEngine();

    // Create two nodes
    const userNode = new DefaultNodeModel({
        name: 'User',
        color: 'rgb(0,192,255)',
    });
    userNode.setPosition(100, 100);

    const ratingNode = new DefaultNodeModel({
        name: 'Rating',
        color: 'rgb(192,255,0)',
    });
    ratingNode.setPosition(400, 100);

    // Create a link for the foreign key relationship
    const link = new DefaultLinkModel();
    link.setSourcePort(userNode.addOutPort('Foreign Key to Rating'));
    link.setTargetPort(ratingNode.addInPort('ID'));

    // Add the nodes and link to the model
    const model = new DiagramModel();
    model.addAll(userNode, ratingNode, link);

    // Load the model into the engine
    engine.setModel(model);

    return (
        <div style={{ height: '500px', width: '100%', backgroundColor: 'white' }}>
            <CanvasWidget engine={engine} />
        </div>
    );
}

export default DataModelDiagram;
